css:
/* BEGIN Keep in sync with nuclide-ui/styles/fb-FileChanges: */
.nuclide-conflict-resolver-text-decoration {
  border-left-style: solid;
  border-left-color: #e2c08d;
  border-left-width: 1px;
  background-color: rgba(226, 192, 141, 0.1);
}
/* END Keep in sync with nuclide-ui/styles/fb-FileChanges: */
.nuclide-conflict-resolver-change-selector-avatar {
  border: 2px solid #d7dae0;
  margin-right: 4px;
  margin-top: 4px;
}
.nuclide-conflict-resolver-empty-message {
  font-style: italic;
  padding: 1em;
  text-align: center;
}
.nuclide-conflict-resolver-empty-table .nuclide-ui-table {
  border-bottom-width: 0;
}
.nuclide-conflict-resolver-overlay-container {
  display: flex;
  align-items: center;
  flex-direction: row;
  font-family: sans-serif;
  padding: 2px;
}
.nuclide-conflict-resolver-overlay-button {
  align-items: center;
}
.nuclide-conflict-resolver-overlay-tools {
  display: flex;
  flex-direction: row;
  align-items: center;
}
.nuclide-conflict-resolver-pane {
  display: flex;
  flex: 1;
  flex-direction: column;
}
.nuclide-conflict-resolver-table {
  display: flex;
  flex-direction: column;
  overflow-y: scroll;
}
.nuclide-conflict-resolver-table .nuclide-ui-table {
  border-left: 0;
}
.nuclide-conflict-resolver-task-indicator {
  margin-left: 2px;
}
.nuclide-conflict-resolver-task-indicator-container {
  display: flex;
  flex-direction: row;
  align-items: center;
}
